import React, { Component } from 'react'
import ActionButton from "./components/ActionButton"
import './App.scss';


class App extends Component {
  constructor() {
    super()
    this.state = {
      publicScreen: true,
    }
  }

  componentDidMount() {}


  render() {
    return (
      <div className="app h-100">
        <div className="sliding-header d-flex">
          <div className={"public-tab col-6 text-center bold" + (this.state.publicScreen ? 'blue' : null)}><p>Public</p></div>
          <div className={"private-tab col-6 text-center bold" + (!this.state.publicScreen ? 'blue' : null)}><p>Private</p></div>
        </div>
      </div>
    )
  }
}

export default App
